        //function to populate timePicker dropdowns
        function timePicker() {
            var hr;
            var min;
            var sec;

            for (hr = 1; hr <= 12; hr++) {
                if (hr <= 9) {
                    vm.hrs.push('0' + hr);
                } else {
                    vm.hrs.push(hr);
                }
            }
            for (min = 0; min <= 59; min++) {
                if (min <= 9) {
                    vm.mins.push('0' + min);
                } else {
                    vm.mins.push(min);
                }
            }
            for (sec = 0; sec <= 59; sec++) {
                if (sec <= 9) {
                    vm.secs.push('0' + sec);
                } else {
                    vm.secs.push(sec);
                }
            }
        }


